import styles from './Header.module.css';

const Header = () => {
  return (
    <nav className={styles.header}>
      <ul>
        <li>01. About</li>
        <li>02. Experience</li>
        <li>03. Works</li>
        <li>04. Contact</li>
      </ul>
      <ul>
        <li>
          <button type="button">Resume</button>
        </li>
      </ul>
    </nav>
  );
};

export default Header;
